fetch('https://swapi-api.hbtn.io/api/films/?format=json')
  .then((response) => {
    if (!response.ok) {
      throw new Error('Erreur réseau');
    }
    return response.json(); // Traiter la réponse JSON ici
  })
  .then((data) => {
    console.log(data);
  })
  .catch((error) => {
    console.error('Erreur:', error);
  });
